"Text options: 1,size,prepend,append,max with size in chars, prepend will be displayed before the field append will be displayed just after, max is the maximum number of characters that can be saved, and initial 1 to make that next text field or checkbox is in same row. If you indicate only 1 it means next field is in same row too." => "Opciones de texto: 1, tamaño, prefijar, sufijar, max con tamaño en caracteres, prefijar será desplegado antes del campo, sufijar será mostrado justo después, max es el número máximo de caracteres que pueden ser guardados, y el 1 inicial para hacer que el siguiente campo de texto o checkbox esté en la misma fila. Si indica sólo 1 significa que el siguiente campo estará en la misma fila tambien..",
"Checkbox options: put 1 if you need that next field is on the same row." => "Opciones de Checkbox: ponga 1 si necesita que el siguiente campo esté en la misma fila.",
"Numeric options: 1,size,prepend,append with size in chars, prepend will be displayed before the field append will be displayed just after, and initial 1 to make that next text field or checkbox is in same row. If you indicate only 1 it means next field is in same row too." => "Opciones numéricas: 1,tamaño,prefijar,sufijar con tamaño en caracteres, prefijar será desplegado antes del campo, sufijar será desplegado justo después, y el 1 inicial para hacer que el siguiente campo de texto o checkbox esté en la misma línea. Si indica sólo 1 indica que el siguiente campo estará en la misma fila tambien.",
"Dropdown options: list of items separated with commas." => "Opciones de Dropdown: lista de ítems separadas por comas.",
"Group Selector: use options for automatic field feeding : you can use 1 for group of creation and 2 for group where modification come from. The default group has to be set, or the first group that come is chosen for a user, or the default group is Registered." => "Selector de Grupo: use opciones para alimentación automática del campo: puede usar 1 para el grupo de creación o 2 para el grupo de donde viene la modificación. El grupo por defecto debe de configurarse, o el primer grupo que viene es elegido del usuario, o el grupo por defecto es Registrados.",
"Action options: Label,post,tiki-index.php,page:fieldname,highlight=test" => "Opciones de Acción: etiqueta, enviar,tiki-index.php,page:nombredecampo,highlight=test",
